ption\":0,\"isDefaultImage\":false,\"showCallToAction\":false,\"isDefaultImageLoaded\":false,\"isCustomImageLoaded\":false,\"showFeatureText\":false}],\"isFullWidth\":true}}},{\"position\":{\"zoneIndex\":2,\"sectionIndex\":1,\"controlIndex\":0.5,\"sectionFactor\":12,\"layoutIndex\":1},\"controlType\":3,\"id\":\"6a11488e-87eb-4baf-9f02-5dd4de7b91f1\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":1188,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"6a11488e-87eb-4baf-9f02-5dd4de7b91f1\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"32096b73-e358-47ff-9c32-fbbeec1ba10d\",\"position\":{\"zoneIndex\":2,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXxLarge\\\">\u003cstrong>Team Profile\u003c/strong>\u003c/span>\u003c/p>\"},{\"controlType\":4,\"id\":\"21dd9ab2-60d2-4790-9fc4-2fcd6bb143c2\",\"position\":{\"zoneIndex\":2.625,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXLargePlus\\\">Get to know us and our Myers Briggs Type Indicator, Personality Trait and Learning Styles.\u003c/span>\u003c/p>\"},{\"controlType\":4,\"id\":\"b776a5b4-180b-4233-a3f2-dcfbb3de2342\",\"position\":{\"zoneIndex\":3.484375,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":6,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp style=\\\"margin-left:8px;\\\">\u003cstrong>Hoang Duc Phuong\u003c/strong>\u003cstrong>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan> (S3885751):\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/strong>\u003c/p>\u003cul>\u003cli>\u003cspan>\u003cspan>My name is Hoang Duc Phuong (s3885751), and I am now a student at RMIT University in Melbourne, Australia. Even though I am twenty years old, this is my first year at RMIT. My family and I are devout Christians, so we devote an hour on Sundays to attending church services. I had just returned to Viet Nam last year due to the pandemic, which occurred while I was studying in Australia for two years at the time. I have already completed my first semester at Swinburne University in Australia, however I have decided to leave the university and return to Viet Nam. In addition, I am a person who is full of energy. In the meantime, I participate in a variety of activities, including tennis on Mondays, Wednesdays, and Fridays, and soccer on Thursdays. If anyone is interested in joining me, please contact me through my school email address: s3885751@rmit.edu.vn or my phone number: 0824933333.\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003cp>\u003cspan>\u003cspan>\u003cstrong>What these tests mean for you&nbsp;?\u003c/strong>\u003c/span>\u003c/span>\u003c/p>\u003cul>\u003cli>\u003cspan>\u003cspan>\u003cstrong>​​​​​​​\u003c/strong>These tests illustrates the strengths and weaknesses on how I study and which way is the best for me to learn. These also show me the area I need to improve to be better.\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003cp>\u003cspan class=\\\"fontSizeLarge\\\">\u003cstrong>How do you think these results may influence your behaviour in a team ?\u003c/strong>\u003c/span>\u003cspan class=\\\"fontSizeLarge\\\">\u003cstrong>​​​​​​​\u003c/strong>\u003c/span>\u003c/p>\u003cul>\u003cli>Personally,\u003cstrong>&nbsp;\u003c/strong>the tests will not affect my behaviour much when I am in a team. This tests demonstrate the cooperation when we are in a team. The weaknesses of this member&nbsp;can be a strengths of others member. If we can compensate what we are missing, the more we can succeed.\u003c/li>\u003c/ul>\u003cp>\u003cb>How should you take this into account when forming a team ?\u003c/b>\u003c/p>\u003cul>\u003cli>I would not only look at their results to determine whether or not they qualify to be my teammates, however it does assist to understand when people with a specific personality might have differing points of view on some issues to a certain level, like in the case with my teammates. At the end of the day, being able to collaborate effectively with others is my primary priority.​​​​​​​\u003cspan>\u003cspan>​​​​​​​\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\"},{\"position\":{\"zoneIndex\":3.484375,\"sectionIndex\":2,\"controlIndex\":0.75,\"sectionFactor\":6,\"layoutIndex\":1},\"controlType\":3,\"id\":\"aafe57ef-41b6-4b0d-b8d7-0258d33782f1\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":391,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"aafe57ef-41b6-4b0d-b8d7-0258d33782f1\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Myers Briggs Type Indicator\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/2391538633-PHmbti.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"b7d2dce listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"f498e085-9367-470c-884c-52671cdb152d\",\"imgWidth\":1152,\"imgHeight\":648,\"alignment\":\"Center\",\"resizeCoefficient\":1,\"resizeDesiredWidth\":574,\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":3.484375,\"sectionIndex\":2,\"controlIndex\":2.5,\"layoutIndex\":1,\"sectionFactor\":6},\"controlType\":3,\"id\":\"a43c6f63-59ee-4b90-96cf-cabce9e7c2b0\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":210,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"a43c6f63-59ee-4b90-96cf-cabce9e7c2b0\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Learning Styles\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/2478865220-PHlearning.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"b2fcd0ad-90b7-4fbb-8836-1c5d9a474d6d\",\"imgwidth\":\"1235\",\"imgheight\":\"399\"}}},\"dataVersion\":\"1.9\",\"properties\":{\"imageSourceType\":2,\"altText\":\"\",\"linkUrl\":\"\",\"overlayText\":\"\",\"fileName\":\"PHlearning.png\",\"siteId\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webId\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"b2fcd0ad-90b7-4fbb-8836-1c5d9a474d6d\",\"imgWidth\":1235,\"imgHeight\":399,\"alignment\":\"Center\",\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":3.548828125,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"controlType\":3,\"id\":\"d17fe7d2-b9a9-4a25-956a-d17eb70234fe\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":1188,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"d17fe7d2-b9a9-4a25-956a-d17eb70234fe\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"1090e639-5809-4db0-9c5c-cbd378331325\",\"position\":{\"zoneIndex\":3.61328125,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":6,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp style=\\\"margin-left:8px;\\\">\u003cstrong>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>Nwar Alain Bin Hazmi (S3915079):\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/strong>\u003cbr>\u003cbr>\u003c/p>\u003cul>\u003cli>\u003cspan>\u003cspan>\u003cspan>My name is Nwar Alain Bin Hazmi, people generally call me by my second name Alain/Alan. \u003cspan>I have lived in 5 different countries, Malaysia (5 Years), Korea (1 Year), Sudan (3 Years), Singapore (12 Years) and now Vietnam. Prior coming to RMIT, I used to work as an IT engineer for four years in total. I am interested in Cloud computing technologies and I wish to dive deeper while undertaking my degree. I enjoy playing the piano, boxing and playing first-person shooter games on my laptop.\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003cspan>\u003cspan>\u003cspan>\u003cspan>​​​​​​​​​​​\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003cp>\u003cstrong>What do the results of these tests mean for you?\u003c/strong>\u003cbr>\u003cbr>\u003c/p>\u003cul>\u003cli>The results of these tests, to a certain extent, gave me a better understanding of what are my strengths and weaknesses and how I should improve on my weaknesses and work on my strengths.\u003c/li>\u003c/ul>\u003cp>\u003cspan class=\\\"fontSizeLarge\\\">\u003cstrong>How do you think these results may influence your behaviour in a team?\u003c/strong>\u003c/span>\u003cbr>\u003cbr>\u003c/p>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan class=\\\"fontSizeLarge\\\">It would have not much influence on my behaviour within a team, as most cases, when working with a team is to be a team-player. It’s about helping one another and fill in roles where others are struggling with and excel together as a unit. I do believe to a certain extent, after knowing my agreeableness level, it helps with my ability to come into an understanding better from another party when we have any disagreements.\u003c/span>\u003c/li>\u003c/ul>\u003cp>\u003cstrong>\u003cspan class=\\\"fontSizeLarge\\\">How should you take this into account when forming a team?\u003cbr>​​​​​​​\u003c/span>\u003c/strong>\u003c/p>\u003cul>\u003cli>\u003cspan class=\\\"fontSizeLarge\\\">I would not simply look into their results to influence my decision whether they qualify to be my teammates, although it does help to understand when a person have a certain personality might have different views on things to a certain extent. Ultimately, having the ability to work well within a team is my top priority.\u003c/span>\u003c/li>\u003c/ul>\"},{\"position\":{\"controlIndex\":0.0625,\"sectionIndex\":2,\"sectionFactor\":6,\"zoneIndex\":3.61328125,\"layoutIndex\":1},\"controlType\":3,\"id\":\"9079afbb-c401-4987-975c-351ae6a72ee9\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":319,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"inst anh Minh (s3915233)\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/strong>\u003cbr>\u003cbr>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>My name is Nguyen Hoanh Minh (s3915233), I’m currently studying my second semester in RMIT University here in Saigon. Before that, I’ve spent 2 years studying in the US, my Senior year of high school and my first year of university as an Electrical Engineering Student. I’ve spent most of my high school years working on IoT, STEM and robotics projects, including participating in related clubs, too. Due to covid, I was forced to return home last year. I’ve worked in minor roles as a Market Research and a Product Operations intern. It was through my time in Product Operations that I found my interests in IT. My dream job in the IT field is currently still in its early stages, but so far, I’ve found interest in software development, and I hope that through studying here, my dream job would be more concrete. Some of my hobbies are: playing my classical music on my guitar, listening to music, running (daily), swimming and playing video games.\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/p>\"},{\"position\":{\"zoneIndex\":3.7421875,\"sectionIndex\":2,\"controlIndex\":1,\"sectionFactor\":6,\"layoutIndex\":1},\"controlType\":3,\"id\":\"c9c7ca35-5d1a-463a-8527-b9f085d502b1\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":410,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"c9c7ca35-5d1a-463a-8527-b9f085d502b1\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Myers Briggs Type Indicator\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/606784386-MinhMBTI.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"4c631b46-6479-47da-b438-93848057e2ce\",\"imgwidth\":\"1129\",\"imgheight\":\"717\"}}},\"dataVersion\":\"1.9\",\"properties\":{\"imageSourceType\":2,\"altText\":\"a screenshot of a cell phone\",\"linkUrl\":\"\",\"overlayText\":\"\",\"fileName\":\"MinhMBTI.png\",\"siteId\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webId\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"4c631b46-6479-47da-b438-93848057e2ce\",\"imgWidth\":1129,\"imgHeight\":717,\"alignment\":\"Center\",\"resizeCoefficient\":1,\"resizeDesiredWidth\":574,\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":3.7421875,\"sectionIndex\":2,\"controlIndex\":2,\"layoutIndex\":1,\"sectionFactor\":6},\"controlType\":3,\"id\":\"e3ef5235-d0d5-47b5-a6bb-3c77904d5a73\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":289,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"e3ef5235-d0d5-47b5-a6bb-3c77904d5a73\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Learning Styles\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/781175603-MinhLearning.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"309526db-0a12-476f-8a9e-efa0b5e4e0a8\",\"imgwidth\":\"870\",\"imgheight\":\"401\"}}},\"dataVersion\":\"1.9\",\"properties\":{\"imageSourceType\":2,\"altText\":\"\",\"linkUrl\":\"\",\"overlayText\":\"\",\"fileName\":\"MinhLearning.png\",\"siteId\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webId\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"309526db-0a12-476f-8a9e-efa0b5e4e0a8\",\"imgWidth\":870,\"imgHeight\":401,\"alignment\":\"Center\",\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":3.806640625,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"controlType\":3,\"id\":\"95243892-a9ca-4678-80cc-6a2b9f93c68e\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":1188,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"95243892-a9ca-4678-80cc-6a2b9f93c68e\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"cd7ac014-c527-4c7e-a1b4-e33a6cd3e0dc\",\"position\":{\"zoneIndex\":3.87109375,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":6,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp style=\\\"margin-left:8px;\\\">\u003cstrong>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>Khoi Minh Tran (S3916827):\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/strong>\u003c/p>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>\u003cspan>My name is Khoi Minh Tran and this is my second semester at RMIT University. I have studied aboard in United States for almost four years and have lots of experience in English. I choose RMIT because I get used to learn everything by English, also I can have a chance to keep improving it and RMIT can guide me to choose IT job that suit me best since I have not decided it yet. I love playing soccer, badminton and playing games.\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003cp>\u003cstrong>What do the result of the test mean to you?&nbsp;\u003c/strong>\u003c/p>\u003cul>\u003cli>​​​​​​​The results of these tests are helping me to better understand myself; before to completing these exams, I had no idea what sort of personality I had. Nowadays, I don't pay attention to my activities; I just do whatever I want and don't think those acts show my personality in any way. In the Myer-Briggs Test, most of the questions I answer are neutral, indicating that I still do not understand myself well.&nbsp;\u003c/li>\u003c/ul>\u003cp>\u003cstrong>How do you think these results may influence your behaviour in a team?\u003c/strong>\u003c/p>\u003cul>\u003cli>\u003cstrong>​​​​​​​\u003c/strong>Those results may have no impact on my conduct in a team since I continue to do what I normally do in my life. I used to work as a team, and I still do what the tests suggest. I utilize logic to produce the report and explain things, as well as to communicate with my coworkers. Even if I am unaware of the project, I am typically inquisitive about what it is. Even if it does not affect me, I want to know so that I may improve the project and aid my friends.&nbsp;\u003c/li>\u003c/ul>\u003cp>\u003cstrong>How should you take this into account when forming a team?\u003c/strong>\u003c/p>\u003cul>\u003cli>I think those results are really excellent, and if other people see them, they will want me on their squad. Because I am a logical person, when we debate something, I use logic to explain and make sense to the other team members. I do not say anything that is not logical and confuses everyone. Also, I am adaptable, which means that once my team has decided on a project, I can be adaptable to discover something that I can accomplish well. In terms of visuals, I can make things more colorful to make people feel more joyous in the project and less bored because most people prefer beautiful things, right?\u003c/li>\u003c/ul>\u003cp>\u003cbr>\u003c/p>\"},{\"position\":{\"zoneIndex\":3.87109375,\"sectionIndex\":2,\"controlIndex\":1,\"sectionFactor\":6,\"layoutIndex\":1},\"controlType\":3,\"id\":\"15478a5d-7d23-4483-8017-6feb0361b465\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":351,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"15478a5d-7d23-4483-8017-6feb0361b465\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Myers Briggs Type Indicator\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/2969525681-KhoiMBTI.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"2348cd95-122b-41ec-9d95-c91ec343a33c\",\"imgwidth\":\"1379\",\"imgheight\":\"733\"}}},\"dataVersion\":\"1.9\",\"properties\":{\"imageSourceType\":2,\"altText\":\"\",\"linkUrl\":\"\",\"overlayText\":\"\",\"fileName\":\"KhoiMBTI.png\",\"siteId\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webId\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"2348cd95-122b-41ec-9d95-c91ec343a33c\",\"imgWidth\":1379,\"imgHeight\":733,\"alignment\":\"Center\",\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":3.87109375,\"sectionIndex\":2,\"controlIndex\":1.5,\"layoutIndex\":1,\"sectionFactor\":6},\"controlType\":3,\"id\":\"929055cb-0431-49ab-854d-ca14d743d785\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":284,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"929055cb-0431-49ab-854d-ca14d743d785\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Personality Trait\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/3677748625-KhoiPersonality.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"a3b7d141-f3df-45b6-b58a-9c2cc814b13e\",\"imgwidth\":\"602\",\"imgheight\":\"272\"}}},\"dataVersion\":\"1.9\",\"properties\":{\"imageSourceType\":2,\"altText\":\"\",\"linkUrl\":\"\",\"overlayText\":\"\",\"fileName\":\"KhoiPersonality.png\",\"siteId\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webId\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"a3b7d141-f3df-45b6-b58a-9c2cc814b13e\",\"imgWidth\":602,\"imgHeight\":272,\"alignment\":\"Center\",\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":3.87109375,\"sectionIndex\":2,\"controlIndex\":2,\"layoutIndex\":1,\"sectionFactor\":6},\"controlType\":3,\"id\":\"a0d87b2a-e620-4df9-9abb-4dd839fc020c\",\"webPartId\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":332,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"d1d91016-032f-456d-98a4-721247c305e8\",\"instanceId\":\"a0d87b2a-e620-4df9-9abb-4dd839fc020c\",\"title\":\"Image\",\"description\":\"Add an image, picture or photo to your page including text overlays and ability to crop and resize images.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{\"captionText\":\"Learning Styles\"},\"imageSources\":{\"imageSource\":\"/sites/Group9_COSC2083/SiteAssets/SitePages/ShowcaseHome/850882177-KhoiLearning.png\"},\"links\":{},\"customMetadata\":{\"imageSource\":{\"siteid\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webid\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listid\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueid\":\"c2cb2e46-30c3-4201-98d1-4e27f2d62775\",\"imgwidth\":\"602\",\"imgheight\":\"323\"}}},\"dataVersion\":\"1.9\",\"properties\":{\"imageSourceType\":2,\"altText\":\"a screenshot of a social media post\",\"linkUrl\":\"\",\"overlayText\":\"\",\"fileName\":\"KhoiLearning.png\",\"siteId\":\"feed870d-a31e-4dcb-ba75-0deebef5f3eb\",\"webId\":\"91a675bb-faca-4b5e-ad42-173108a4aae4\",\"listId\":\"83d0af95-0f8b-4bac-aeac-ce0bb8752444\",\"uniqueId\":\"c2cb2e46-30c3-4201-98d1-4e27f2d62775\",\"imgWidth\":602,\"imgHeight\":323,\"alignment\":\"Center\",\"fixAspectRatio\":false}}},{\"position\":{\"zoneIndex\":4,\"sectionIndex\":1,\"controlIndex\":0.5,\"layoutIndex\":1},\"controlType\":3,\"id\":\"bff3f973-f6ad-4141-9055-d394ae91d85a\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":1188,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"bff3f973-f6ad-4141-9055-d394ae91d85a\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"093ebfca-63e1-4288-ac8d-dfc84792a677\",\"position\":{\"zoneIndex\":4,\"sectionIndex\":1,\"controlIndex\":1,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXxLarge\\\">\u003cstrong>IT Work\u003c/strong>\u003c/span>\u003c/p>\"},{\"controlType\":4,\"id\":\"0d871a09-e1a1-44f6-aec7-b7025e4d3ef0\",\"position\":{\"zoneIndex\":5,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">What kind of work is done by the IT Professional?\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>\u003cspan>\u003cspan>Working as an Infrastructure engineer, maintaining the current environment on&nbsp;Microsoft Azure to perform as expected. He manages a change request which is the addition, modification, or removal of anything that could have a direct or indirect effect on services according to ITIL standard requested by the customers or new considerations from the solution architect or subject matter expert. With each environment he also in charge of setting up new virtual machine which host web and application servers. Every month he has a scheduled maintenance to update all the application and web servers \u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003cbr>\u003cbr>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">What kinds of people does the IT professional interact with? Are they other IT professionals? Clients? Investors? The general public?\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>\u003cspan>\u003cspan>He is currently working in a group comprises of other IT professionals. Working with clients directly, at times he will need to interact with the key stake holders and generally during those meetings, a solution architect and a subject matter expert would be present. Whenever a change request is required, he will need to interact with the Change Advisory Members for them to approve the change request. &nbsp;\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003cbr>\u003cbr>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">Where do the IT professionals spend most of their time?\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>\u003cspan>\u003cspan>Normally he spends most of his time at office at his desktop. There are times where sensitive info are required, therefore he will often travel to the customer office to discuss and exchange information.\u003cbr>​​​​​​​ \u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">What aspect of their position is most challenging?\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>\u003cspan>\u003cspan>Managing expectations of the customer. Customers may have the misconception that we are responsible for any issues faced which needs to be fixed within a day, but ultimately there are some issues which requires more than a day and multiple trial and error runs, for other issues it&nbsp;might escalate further and involve the Solution Architect (SA),&nbsp;Subject Matter Expert (SME) and other key personnel such as the project manager.&nbsp;&nbsp;&nbsp;\u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003cbr>\u003cbr>\u003c/li>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>\u003cspan>\u003cspan>At times during launch of a certain application, the engineer would need to monitor all functioning components of the environment is working as expected, if&nbsp;there are any issues that appear throughout his cycle (which may take up to weeks)&nbsp;he will need to troubleshoot which may escalate to a Solution Architect (SA), Subject Matter Expert (SME) and the customer themselves, which could happen at any given time. \u003c/span>\u003c/span>\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\"},{\"position\":{\"zoneIndex\":6,\"sectionIndex\":1,\"controlIndex\":1,\"layoutIndex\":1},\"controlType\":3,\"id\":\"38f8102a-1471-47d5-a063-b43db6f27f24\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":1188,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"38f8102a-1471-47d5-a063-b43db6f27f24\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"60395d7b-66ad-491c-9beb-ff30a04a0d43\",\"position\":{\"zoneIndex\":6,\"sectionIndex\":1,\"controlIndex\":2,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXxLarge\\\">\u003cstrong>IT Technologies\u003c/strong>\u003c/span>\u003c/p>\"},{\"controlType\":4,\"id\":\"0c46d267-bac0-4d31-9aa6-a90550028dd2\",\"position\":{\"zoneIndex\":6.5,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cstrong>Cybersecurity and privacy\u003c/strong>\u003c/p>\u003cp>The technique of protecting electronic systems, networks, and data, including computers, servers, mobile devices, and other electronic devices, from hostile intrusions is known as cyber security. Electronic information security and information technology security are other terms for the same thing. For example, the phrase can be used in a wide range of contexts, from the workplace to mobile computing. Here are some example of what security can be done nowadays.\u003c/p>\u003cul>\u003cli>Network security: Protecting a computer network from intruders, whether they're malicious insiders or random invaders, is what network security is all about.\u003c/li>\u003cli>Application security:&nbsp;The goal of application security is to avoid software and devices from being infected by malicious code. In the event of an application being hacked, the data it is supposed to safeguard could be accessed. In order for a software or gadget to be secure, it must be designed before it is put into use.\u003c/li>\u003cli>Information security:&nbsp;Application security is concerned with preventing harmful code from infecting software and devices. Data that is supposed to be protected by an application can be accessible if it is hacked. Before it can be used, a piece of software or gadget must be thoroughly tested for security flaws.\u003c/li>\u003c/ul>\u003cp>Cybersecurity can only be done now by human physically.&nbsp;As cyberattacks become more sophisticated and difficult to predict, businesses are doing all in their power to protect themselves. Identifying the next significant malware threat is even more difficult, as the Zeus trojan and Locky ransomware were once serious concerns, but today things like Emotet botnet, Trickbot trojan, and Ryuk ransomware are things to watch out for. Cyber criminals take advantage of the fact that it's tough to protect your perimeter against unknown threats.\u003c/p>\u003cp>A growing number of cybersecurity systems are leveraging artificial intelligence (AI) and machine learning (ML) to identify possible hazards, such as an employee account that is clicking on suspicious links, or a new type of malware. The fight between attackers and defenders remains ongoing, however. It's not a new strategy for cybercriminals to modify their malware code so that it's no longer flagged as bad.&nbsp;Defenders are increasingly relying on AI and ML to detect even the most obscure new varieties of malware attack, because it is difficult to detect malware that has been purposefully disguised. The machine-learning database is able to get information on any previously discovered virus. By checking the code against the database, the system is able to detect new forms of malware, such as altered variants of current malware or completely original threats, and stop them if comparable occurrences have previously been identified as malicious.\u003c/p>\u003cp>In cybersecurity, machine learning can identify and respond to possible problems almost instantly, preventing them from interrupting the operation of the company. As a result of installing AI-based cybersecurity from Darktrace, the McLaren Formula One team hopes to maintain the network's safety without relying on people to accomplish the impossible task of monitoring everything at once.&nbsp;Despite the fact that AI and ML can have a positive impact on cybersecurity, organizations must understand that these tools are not a substitute for human security personnel. As an example, if a machine learning-based security tool has been developed poorly, the algorithms may miss out on things that are obvious or even surprising. This is a big concern if the tool doesn't recognize a particular type of cyberattack since it doesn't take into account key parameters.\u003c/p>\"},{\"controlType\":4,\"id\":\"976835ea-6e61-4e2e-926f-f10ab6c738d3\",\"position\":{\"zoneIndex\":6.5,\"sectionIndex\":1,\"controlIndex\":2,\"layoutIndex\":1,\"sectionFactor\":12},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXLargePlus\\\">\u003cstrong>Cloud Computing&nbsp;\u003c/strong>\u003c/span>\u003cbr>\u003cbr>Simply described, cloud computing is the distribution of computer services over the Internet (\\\"the cloud\\\") in order to provide speedier innovation, more flexible resources, and economies of scale. You normally only pay for the cloud services you use, which helps you cut expenses, manage your infrastructure more effectively, and scale as your business grows.\u003c/p>\"},{\"controlType\":4,\"id\":\"bdd8aa10-65ba-4e5e-a76d-b399b8feade4\",\"position\":{\"zoneIndex\":6.5,\"sectionIndex\":1,\"controlIndex\":3,\"layoutIndex\":1,\"sectionFactor\":12},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>Minh\u003c/p>\"},{\"controlType\":4,\"id\":\"360b60aa-37b8-42c4-bc12-1fd3cfff5947\",\"position\":{\"zoneIndex\":6.5,\"sectionIndex\":1,\"controlIndex\":4,\"layoutIndex\":1,\"sectionFactor\":12},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>Khoi\u003c/p>\"},{\"position\":{\"zoneIndex\":8,\"sectionIndex\":1,\"controlIndex\":1,\"layoutIndex\":1},\"controlType\":3,\"id\":\"3d451297-9c88-4ac7-a750-fa4a024b5fc1\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":1188,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"3d451297-9c88-4ac7-a750-fa4a024b5fc1\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"351b6ce8-a4cf-4658-a8dc-6d7511f46a1e\",\"position\":{\"zoneIndex\":9,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXxLarge\\\">\u003cstrong>Project Ideas\u003c/strong>\u003c/span>\u003c/p>\"},{\"controlType\":4,\"id\":\"05a38ef0-2463-4ad4-8288-3229d9d564a0\",\"position\":{\"zoneIndex\":9,\"sectionIndex\":1,\"controlIndex\":2,\"layoutIndex\":1,\"sectionFactor\":12},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">Overview\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>In terms of our idea, we would like to establish a website or app where gamers can discover teammates to play with. In terms of the website, we will make a link that folks can easily copy and paste. Also, gamers must sign up and enter information such as their name, the game they play, their account details, and a personality to choose from (play for fun, grind hard, etc.) so that the website or app can discover others to play with. Furthermore, it may display people's ratings and remarks from other players, allowing others to determine whether that person is friendly. &nbsp;\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">Motivation\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>Creating a website or program like PlayerDuo, Discord, and others is beneficial for gamers, however this website does not demand payment to play with others. Since the Covid-19 epidemic occurred in Vietnam, we know people may go out as usual right now, but some individuals believe it is still unsafe. Also, with the advancement of technology and the quality of many games, we believe that many people now choose to play online games. So, we believe it will be beneficial if we establish a website where people can look for someone to play with since it is more enjoyable and allows you to meet new people. \u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">Description\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>When you use our website service, clicking on the link or typing the exact website link will take you to our home page. On our main page, the logo or name of the website will be shown in the upper left corner to ensure that clients are visiting the correct website. It will also contain log-in and sign-up buttons in the upper right corner for easy access. If you have already checked in, it will display numerous rooms with many individuals waiting in them, and you may request to join in to play with them. When our website is new and unpopular in Vietnam, we will put a \\\"How it works\\\" guide on a bar for new visitors who are unsure what to do on my website. \\\"How it works\\\" will walk clients through the process of signing up, logging in, entering their information, and so on. When you join up and log in, you will be asked to input your location, what games you play, and other information so that we can identify the best-fit gamers or rooms for you. Following that, we will have \\\"Features,\\\" where you will see what my website is capable of. Well, on our websites, we will have private messaging to make it simpler for people to connect and talk, and it will offer several rooms for people to request, as well as games next to them so people can see what games they are playing. Finally, we will offer \\\"Supports\\\" where clients may seek assistance and send emails to us to resolve issues with the website or the players with whom they play. \u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLarge\\\">\u003cspan class=\\\"fontSizeXLargePlus\\\">Tools and technologies\u003c/span>\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>According to our research, to establish a website, we need website scripting, a web browser, a file transfer protocol, and so on. Contact forms, interactive buttons and controls, website databases, and shared material between web pages are all required in website scripting (What is Needed for a Website? - Code Conquest, 2021). Because each web browser generates HTML and CSS in a unique way, you must guarantee that your website displays and runs properly in each one. We also need web hosting, which is a service that keeps your website files (HTML, CSS, images, scripts, and so on) on a server for anybody to access. A domain name is the address of your website (for example, facebook.com). Another type of protocol is a file transfer protocol (FTP). You must use FTP to transfer your website files from your computer to the server that will host your website. To put it simply, this is the process of uploading files to the Internet. \u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">Skills required\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>You must be proficient in HTML and CSS to create a website. The reason for this is because HTML and CSS are the core languages of websites, and you will need both to create a functional one. HTML without CSS not only looks poor, but it may convey the idea that your site has a fundamental problem. \u003c/span>\u003c/span>\u003c/li>\u003c/ul>\u003ch2>\u003cspan class=\\\"fontSizeXLargePlus\\\">Outcome\u003c/span>\u003c/h2>\u003cul>\u003cli style=\\\"margin-left:8px;\\\">\u003cspan>\u003cspan>If this idea is a success, we will create a large gaming community. People will form several associations with others; they may meet friends or lovers. Individuals will leave the streets, allowing the authorities to easily heal and control other people who are suffering Covid-19. Some people, we know, do not believe in internet dating, but if you are lucky, you could meet a nice individual up there. If you are wondering how we know that we will tell you. So, we have a lot of online friends with whom we play games, and we have met them in person as well. They are unexpectedly kind folks who care about one another. They educated and assisted us in a variety of ways to help us become a better person in life, which we much appreciate. So, we hope that individuals who are going through a tough time may join online and play online games with each other to be happy in life and make a lot of friends, so they do not feel lonely.\u003c/span>\u003c/span>\u003c/li>\u003c/ul>\"},{\"controlType\":4,\"id\":\"4befe45f-3162-40ce-8e8a-ab1a3659086b\",\"position\":{\"zoneIndex\":9.5,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":12,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>\u003cspan class=\\\"fontSizeXxLarge\\\">\u003cstrong>Feedback\u003c/strong>\u003c/span>\u003c/p>\"},{\"controlType\":4,\"id\":\"a5f2216b-d55d-495b-90c0-3d202e4fa4d7\",\"position\":{\"zoneIndex\":10.5,\"sectionIndex\":1,\"controlIndex\":1,\"sectionFactor\":6,\"layoutIndex\":1},\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"addedFromPersistedData\":true,\"innerHTML\":\"\u003cp>Phuong Hoang\u003cbr>\u003cbr>​​​​​​​asdf\u003c/p>\"},{\"position\":{\"zoneIndex\":10.5,\"sectionIndex\":1,\"controlIndex\":1.5,\"layoutIndex\":1,\"sectionFactor\":6},\"controlType\":3,\"id\":\"9ec2d0a8-b231-470b-8aa9-86588d68229b\",\"webPartId\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"emphasis\":{},\"zoneGroupMetadata\":{\"type\":0},\"reservedHeight\":1,\"reservedWidth\":570,\"addedFromPersistedData\":true,\"webPartData\":{\"id\":\"2161a1c6-db61-4731-b97c-3cdb303f7cbb\",\"instanceId\":\"9ec2d0a8-b231-470b-8aa9-86588d68229b\",\"title\":\"Divider\",\"description\":\"Add a line to divide areas on your page.\",\"audiences\":[],\"serverProcessedContent\":{\"htmlStrings\":{},\"searchablePlainTexts\":{},\"imageSources\":{},\"links\":{}},\"dataVersion\":\"1.1\",\"properties\":{\"length\":100,\"weight\":1}}},{\"controlType\":4,\"id\":\"da0688f2
